def two_sum(nums: list[int], target: int) -> list[int]:
    num_index_mapping = {}
    
    for i, num in enumerate(nums):
        complement = target - num
        if complement in num_index_mapping:
            return [num_index_mapping[complement], i]
        num_index_mapping[num] = i

    return None

